import React from 'react';

import Directory from '../../components/directory/directory.component';
import BoxService from '../../components/box-service/box-service.component';

import heroImg from '../../assets/coffee_hero.jpg';

import { HomePageContainer } from './homepage.styles';

const HomePage = () => {
  return (
    <HomePageContainer>
      <div className='image-container'>
        <img src={heroImg} alt='' />
      </div>
      <div className='box-service-container'>
        <BoxService
          title={'shipping & returns'}
          imgUrl='../../assets/truck.svg'
        >
          If your are not 100% satisfied with our products, return them within
          30 days for a full refund. We'll even pay shipping.
        </BoxService>
        <BoxService title='safe payment' imgUrl='../../assets/exchange.svg'>
          Pay with the world's most popular and secure payment methods
        </BoxService>
        <BoxService
          title='shop with confidence'
          imgurl='../../assets/shield.svg'
        >
          Our Buyer Protection covers your purchase from click to delivery.
        </BoxService>
      </div>
      <Directory />
    </HomePageContainer>
  );
};

export default HomePage;
